(11, 0, 0, 0, 0, 0, '', NULL, NULL, '', 'thanh-toan-truc-tiep-tai-cong-ty', '', '', '', '', '- Quý khách hàng vui lòng thanh toán trực tiếp tại công ty ngay khi mua hàng tại\r\nShowroom 1 : Số 103 - 105 Lê Thanh Nghị– Đồng Tâm - Hai Bà Trưng– Hà Nội.\r\nShowroom 2 : Số 58 Hồ Tùng Mậu  – Cầu Giấy – Hà Nội.\r\n- Ngay khi quý khách thanh toán xong, nhân viên kế toán sẽ gửi lại quý khách hóa đơn tài chính và nhân viên kinh doanh sẽ hướng dẫn quý khách hình thức giao nhận hàng.', '', 'Thanh toán trực tiếp tại công ty', NULL, 1, '2024-06-12 08:16:42', 'hienthi', 'hinh-thuc-thanh-toan', 1586480217, '2024-06-12 08:16:42', '2024-06-12 08:16:42', 1597048246, 0, '', ''),
(12, 0, 0, 0, 0, 0, '', NULL, NULL, '', 'thanh-toan-tai-diem-giao-hang', '', '', '', '', '- Quý khách thanh toán cho nhân viên giao nhận toàn bộ hoặc phần còn lại của giá trị đơn hàng đã mua (nếu đã đặt cọc)\r\n- Hình thức thanh toán này chỉ thực hiện với các đơn hàng có địa chỉ giao hàng tại nội thành thành phố Hà Nội (trong phạm vi bán kính 30 km tính từ nơi mua hàng).\r\n- Nếu địa điểm giao hàng ngay tại nơi thanh toán, nhân viên giao hàng của chúng tôi sẽ thu tiền khi giao hàng.', '', 'Thanh toán tại điểm giao hàng', NULL, 2, '2024-06-12 08:16:42', 'hienthi', 'hinh-thuc-thanh-toan', 1586480229, '2024-06-12 08:16:42', '2024-06-12 08:16:42', 0, 0, '', ''),
(13, 0, 0, 0, 0, 0, '', NULL, NULL, '', 'thanh-toan-bang-chuyen-khoan', '', '', '', '', '- Nếu địa điểm giao hàng là ngoại thành, ngoại tỉnh hoặc nội thành thành phố Hà Nội nhưng khác với địa điểm thanh toán (trong trường hợp Quý khách gửi quà, gửi hàng cho bạn bè, đối tác …) chúng tôi sẽ thu tiền trước 100% giá trị đơn hàng + phí vận chuyển theo cước phí tính trong chinh sách vận chuyển bằng phương thức chuyển khoản trước khi giao hàng', '', 'Thanh toán bằng chuyển khoản', NULL, 3, '2024-06-12 08:16:42', 'hienthi', 'hinh-thuc-thanh-toan', 1586480244, '2024-06-12 08:16:42', '2024-06-12 08:16:42', 0, 0, '', ''),
