;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://www.ketnoitieudung.vn/data/ck/images/KT-421.jpg&quot; /&gt;&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;br /&gt;\\r\\n&lt;strong&gt;1.Tiêu chuẩn:&lt;/strong&gt;&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;Tiêu chuẩn Việt Nam: TCVN: 3223-2000-431R.&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;Quy chuẩn Việt Nam: QCVN 21:2010/BGTVT-MW2&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;Tiêu chuẩn Mỹ: ASME/AWS E 6013&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;Tiêu chuẩn Nhật:  JIS  D4313&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;Đăng kiểm NK: KMW2&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;2. Ứng dụng:&lt;/strong&gt;&lt;br /&gt;\\r\\n- Vỏ bọc KT-421 được chế tạo theo hệ Ti Tan đảm bảo cho quá trình hàn thuận lợi.&lt;br /&gt;\\r\\n- Kim tín KT-421 là que hàn carbon thấp phù hợp dùng cho mối hàn thép Carbon và thép hợp kim thấp có kết cấu tải trọng trung bình như: kết cấu nhà xưởng công nghiệp, chi tiết máy, lan can, cửa sắt, ….&lt;br /&gt;\\r\\n- Mối hàn sáng láng, dễ bong xỉ, xỉ bong sạch, nhẹ điện, ít khói, ít bắn tóe.&lt;br /&gt;\\r\\n- Có thể hàn được ở mọi tư thế hàn khác nhau: hàn bằng, hàn ngang, hàn trần, …&lt;br /&gt;\\r\\n- Độ nhạy mồi hồ quang tốt, thời gian ngừng tối đa để mồi lại không dưới 60 giây.&lt;br /&gt;\\r\\n&lt;br /&gt;\\r\\n&lt;b&gt;3. Hướng dẫn sử dụng:&lt;/b&gt;&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;- Chuẩn bị đầy đủ các yếu tố an toàn lao động trước khi hàn. Nguồn điện hàn ổn định&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;- Khi que hàn bị ẩm, hàn dễ bị khói, bắn toé và không ổn định, mối hàn bị rỗ mọt, cần sấy 100&lt;sup&gt;o&lt;/sup&gt;C – 150&lt;sup&gt;o&lt;/sup&gt;C trong 40 - 60 phút trước khi sử dụng.&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;- Tẩy sạch các vết dầu, bụi bẩn bám trên bề mặt vật hàn.&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;- Đảm bảo các khe hở đường hàn, vát mép vật hàn theo đúng quy phạm để đạt được mối hàn ngấu chắc.&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;- Lựa chọn dòng hàn theo hướng dẫn để có thể có được mối hàn ngấu sâu, khả năng làm việc cao.&lt;br /&gt;\\r\\n&lt;strong&gt;4. Cơ tính mối hàn&lt;/strong&gt;&lt;/p&gt;\\r\\n\\r\\n&lt;p&gt;- Giới hạn bền kéo (MPa): 430 min&lt;br /&gt;\\r\\n- Giới hạn chảy (MPa): 345 min&lt;br /&gt;\\r\\n- Độ dãn dài (%): 17 min&lt;br /&gt;\\r\\n- Độ dai va đập ở 0oC (J): 27min&lt;br /&gt;\\r\\n&lt;strong&gt;5. Thành phần hóa học của lớp kim loại hàn (%)&lt;/strong&gt;&lt;br /&gt;\\r\\n- C: 0.20 max&lt;br /&gt;\\r\\n- Mn: 1.2 max&lt;br /&gt;\\r\\n- Si: 1.0 max&lt;br /&gt;\\r\\n- P: 0.030 max&lt;br /&gt;\\r\\n- S: 0.030 max&lt;/p&gt;\\r\\n\\r\\n&lt;h3&gt;THÔNG SỐ KỸ THUẬT&lt;/h3&gt;\\r\\n\\r\\n&lt;table&gt;\\r\\n\\t&lt;colgroup&gt;\\r\\n\\t\\t&lt;col width=&quot;40%&quot; /&gt;\\r\\n\\t\\t&lt;col /&gt;\\r\\n\\t&lt;/colgroup&gt;\\r\\n\\t&lt;tbody&gt;\\r\\n\\t\\t&lt;tr&gt;\\r\\n\\t\\t\\t&lt;td&gt;&lt;strong&gt;Hãng sản xuất&lt;/strong&gt;&lt;/td&gt;\\r\\n\\t\\t\\t&lt;td&gt;Kim Tín&lt;/td&gt;\\r\\n\\t\\t&lt;/tr&gt;\\r\\n\\t\\t&lt;tr&gt;\\r\\n\\t\\t\\t&lt;td&gt;&lt;strong&gt;Xuất xứ&lt;/strong&gt;&lt;/td&gt;\\r\\n\\t\\t\\t&lt;td&gt;Việt Nam&lt;/td&gt;\\r\\n\\t\\t&lt;/tr&gt;\\r\\n\\t\\t&lt;tr&gt;\\r\\n\\t\\t\\t&lt;td&gt;&lt;strong&gt;Đường kính (mm)&lt;/strong&gt;&lt;/td&gt;\\r\\n\\t\\t\\t&lt;td&gt;Ø 3.2&lt;/td&gt;\\r\\n\\t\\t&lt;/tr&gt;\\r\\n\\t\\t&lt;tr&gt;\\r\\n\\t\\t\\t&lt;td&gt;&lt;strong&gt;Chiều dài (mm)&lt;/strong&gt;&lt;/td&gt;\\r\\n\\t\\t\\t&lt;td&gt;350 mm&lt;/td&gt;\\r\\n\\t\\t&lt;/tr&gt;\\r\\n\\t\\t&lt;tr&gt;\\r\\n\\t\\t\\t&lt;td&gt;&lt;strong&gt;Dòng điện hàn bằng&lt;/strong&gt;&lt;/td&gt;\\r\\n\\t\\t\\t&lt;td&gt;90-140 (Ampe)&lt;/td&gt;\\r\\n\\t\\t&lt;/tr&gt;\\r\\n\\t\\t&lt;tr&gt;\\r\\n\\t\\t\\t&lt;td&gt;&lt;strong&gt;Đong điện hàn trần, đứng&lt;/strong&gt;&lt;/td&gt;\\r\\n\\t\\t\\t&lt;td&gt;80-130 (Ampe)&lt;/td&gt;\\r\\n\\t\\t&lt;/tr&gt;\\r\\n\\t\\t&lt;tr&gt;\\r\\n\\t\\t\\t&lt;td&gt;&lt;strong&gt;Quy cách đóng gói&lt;/strong&gt;&lt;/td&gt;\\r\\n\\t\\t\\t&lt;td&gt;Hộp 5 Kg, thùng 20kg&lt;/td&gt;\\r\\n\\t\\t&lt;/tr&gt;\\r\\n\\t&lt;/tbody&gt;\\r\\n&lt;/table&gt;\\r\\n\", \"created_at\": null, \"sale_price\": 80000, \"updated_at\": null, \"date_created\": 1706540932, \"date_updated\": 1713502234, \"regular_price\": 100000}}, \"discount\": 0, \"subtotal\": 160000}}', '2024-05-07 01:21:17', '2024-05-07 01:21:17', NULL),
