(1, 'Nike Zoom công nghệ đệm giày thành công nhất của Nike', 'https://www.google.com/', 'poduct-8-2281-6379.jpg', 'Zoom được xem là công nghệ đệm giày chạy bộ thành công nhất của Nike với hơn một trăm mẫu giày.\r\nKhả năng hoàn trả năng lượng là điểm mấu chốt làm nên thành công đó.', 1620825458, 1),
(2, 'Nike Epic React Phantom, bỏ hoàn toàn dây buộc, dễ xỏ như giày lười', 'https://www.google.com/', 'poduct-9-6725-9826.jpg', 'Nếu bạn đã quá chán với việc buộc và bị tuột dây giày.\r\nAirmax 97 với khóa dây thông minh sẽ giúp bạn không bao giờ phải đối mặt với tình trạng này nữa.', 1620825470, 2);
