INSERT INTO `table_static` (`id`, `photo`, `photo1`, `options`, `slugvi`, `slugen`, `contenten`, `contentvi`, `descen`, `descvi`, `nameen`, `namevi`, `file_attach`, `type`, `status`, `date_created`, `created_at`, `updated_at`, `date_updated`) VALUES
(1, 'about05-1728522916.png', NULL, '{\"p\":\"news-2-1467-6233.jpg\",\"w\":1140,\"h\":800,\"m\":\"image\\/jpeg\"}', 'mitech-group', '', '', '&lt;h2 id=&quot;article_sapo&quot;&gt;&lt;strong&gt;Giá xăng trong nước hôm nay (5/9) được liên bộ Công Thương - Tài chính điều chỉnh giảm lần thứ 3 liên tiếp.&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;Trên cơ sở điều hành của liên bộ Công Thương - Tài chính, các doanh nghiệp đồng loạt điều chỉnh &lt;a href=&quot;http://demo.nina.com.vn/sourcephp8/&quot;&gt;giá xăng dầu1&lt;/a&gt; dầu kể từ 15 giờ hôm nay (5/9). &lt;/p&gt;\r\n\r\n&lt;p&gt;Theo đó, so với cách đây 7 ngày, giá xăng&lt;a href=&quot;https://sieuthixemaybinhduong.com/&quot;&gt; E5&lt;/a&gt; giảm 360 đồng/lít, giá bán là 19.970 đồng/lít. Giá xăng RON 95 hạ 280 đồng/lít, giá bán về mức 20.820 đồng/lít. &lt;/p&gt;\r\n\r\n&lt;p&gt;Tương tự, giá dầu diesel cũng được điều chỉnh giảm 380 đồng/lít, giá bán còn 18.090 đồng/lít. &lt;/p&gt;\r\n\r\n&lt;p&gt;Tại kỳ điều hành này, cơ quan quản lý tiếp tục không trích hay chi Quỹ bình ổn giá với các mặt hàng &lt;a href=&quot;http://demo.nina.com.vn/sourcephp8/&quot;&gt;giá xăng dầu2&lt;/a&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;Hiện dư địa Quỹ bình ổn &lt;a href=&quot;http://demo.nina.com.vn/sourcephp8/ti-vi&quot;&gt;giá xăng dầu3&lt;/a&gt; của một số doanh nghiệp đầu mối ghi nhận mức dương lớn do nhiều kỳ điều hành gần đây không sử dụng quỹ.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Giá xăng được điều chỉnh giảm. Ảnh: Minh Hiền&quot; data-was-processed=&quot;true&quot; src=&quot;https://icdn.24h.com.vn/upload/3-2024/images/2024-09-05//1725521710-gia-xang-1-1570-width1920height1207.jpg&quot; width=&quot;740&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Giá xăng được điều chỉnh giảm. Ảnh: Minh Hiền&lt;/p&gt;\r\n\r\n&lt;p&gt;Tính đến ngày 4/9, Petrolimex ghi nhận mức dương quỹ 3.079 tỷ đồng; Saigon Petro dương 328 tỷ đồng; Petimex dương 460 tỷ đồng; PV Oil âm quỹ hơn 138 tỷ đồng...&lt;/p&gt;\r\n\r\n&lt;p&gt;Tại dự thảo nghị định về kinh doanh xăng dầu mới đây, Bộ Công Thương đề xuất cấm thương nhân phân phối mua bán xăng dầu lẫn nhau.&lt;/p&gt;\r\n\r\n&lt;p&gt;Bộ Công Thương lo ngại, nếu cho phép thương nhân phân phối mua bán xăng dầu lẫn nhau sẽ dẫn đến mua bán lòng vòng, qua nhiều tầng nấc trung gian, đẩy giá xăng dầu lên cao. &lt;/p&gt;\r\n\r\n&lt;p&gt;Trong khi đó, cũng có ý kiến lo ngại khi cho thương nhân phân phối xăng dầu của nhau sẽ không kiểm soát được nguồn cung xăng dầu…&lt;/p&gt;\r\n\r\n&lt;p&gt;Bộ Tư pháp cũng chỉ ra bất cập của dự thảo nghị định này khi quy định thương nhân phân phối xăng dầu không được mua bán xăng dầu lẫn nhau.&lt;/p&gt;\r\n\r\n&lt;p&gt;&quot;Việc giới hạn như trên về nguyên tắc sẽ làm hạn chế lựa chọn nguồn cung xăng dầu của các thương nhân phân phối xăng dầu, có thể chưa phù hợp với chính sách của Nhà nước về cạnh tranh tại khoản 2 Điều 6 Luật Cạnh tranh năm 2018&quot;, Bộ Tư pháp nêu ý kiến thẩm định.&lt;/p&gt;\r\n', 'Soon after, products that used Flyknit bodies were bought by athletes and casual users alike, leading to a sales boom.\nThe flyknit shoes, while very expensive, sell out quickly. This reinforces Nike&#039;s market leadership in sports.', '&lt;p&gt;Theo đó, so với cách đây 7 ngày, giá xăng&lt;a href=&quot;https://sieuthixemaybinhduong.com/&quot;&gt; E5&lt;/a&gt; giảm 360 đồng/lít, giá bán là 19.970 đồng/lít. Giá xăng RON 95 hạ 280 đồng/lít, giá bán về mức 20.820 đồng/lít. &lt;/p&gt;\r\n\r\n&lt;p&gt;Tương tự, giá dầu diesel cũng được điều chỉnh giảm 380 đồng/lít, giá bán còn 18.090 đồng/lít. &lt;/p&gt;\r\n\r\n&lt;p&gt;Tại kỳ điều hành này, cơ quan quản lý tiếp tục không trích hay chi Quỹ bình ổn giá với các mặt hàng &lt;a href=&quot;http://demo.nina.com.vn/sourcephp8/&quot;&gt;giá xăng dầu2&lt;/a&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;Hiện dư địa Quỹ bình ổn &lt;a href=&quot;http://demo.nina.com.vn/sourcephp8/ti-vi&quot;&gt;giá xăng dầu3&lt;/a&gt; của một số doanh nghiệp đầu mối ghi nhận mức dương lớn do nhiều kỳ điều hành gần đây không sử dụng quỹ.&lt;/p&gt;\r\n', 'About us', 'Thông tin công ty', '', 'gioi-thieu', 'hienthi', 1609288150, NULL, '2024-10-10 01:15:17', 1728522916),
(6, NULL, NULL, NULL, NULL, NULL, NULL, '&lt;p&gt;Địa chỉ:  Quận 12. TP.HCM&lt;/p&gt;\r\n\r\n&lt;p&gt;Email:  email@gmail.com&lt;/p&gt;\r\n\r\n&lt;p&gt;Hotline: xxx-xxx-xxxx&lt;/p&gt;\r\n\r\n&lt;p&gt;Http://website.com.vn&lt;/p&gt;\r\n', NULL, NULL, NULL, 'Thông tin công ty', NULL, 'lienhe', 'hienthi', 1718262033, '2024-06-13 07:00:33', '2024-10-11 06:08:24', 1728626904),
